import React from 'react';

type ButtonType = {
    name:string
    started:()=>void
}


export  const Button = (props:ButtonType) => {

    const onClickHandler = ()=> {
        props.started()
    }
    return (
        <div>
            <button onClick={onClickHandler}>{props.name}</button>
        </div>
    );
};
